import Layout from '../components/MyLayout.js'
import Link from 'next/link'

export default () => (
  /* Consistent Layout used across pages */
  <Layout>
    <h1>Magic 8 Ball</h1>

    <form className="question-input">
      <input type="text" ref="question" placeholder="Ask your question..."/>
      <input type="submit" placeholder="Shake"/>
    </form>

    <style jsx>{`
      h1 {
        font-family:"Arial";
        font-size:50px;
      }`}
    </style>
  </Layout>
)
